    private static InterpolatingDoubleTreeMap createMap(double[][] data) {
        final InterpolatingDoubleTreeMap map = new InterpolatingDoubleTreeMap();
        for (double[] point : data)
            map.put(point[0], point[1]);
        return map;
    }

    public static double calculateVelocity(double distance, double robotVelocity) {
        return interpolate2D(VELOCITY_MAPS, distance, robotVelocity);
    }

    public static double calculatePitch(double distance, double robotVelocity) {
        return interpolate2D(PITCH_MAPS, distance, robotVelocity);
    }

    private static double interpolate2D(
            Map<Double, InterpolatingDoubleTreeMap> maps,
            double distance,
            double robotVelocity
    ) {
        Double lowerDist = null;
        Double upperDist = null;

        for (Double dist : maps.keySet()) {
            if (dist <= distance) {
                lowerDist = dist;
            }
            if (dist >= distance && upperDist == null) {
                upperDist = dist;
            }
        }

        if (lowerDist == null && upperDist == null) {
            System.err.println("ShootingLookupTable: No data available!");
            return 0.0;
        }

        if (lowerDist == null)
            return maps.get(upperDist).get(robotVelocity);

        if (upperDist == null)
            return maps.get(lowerDist).get(robotVelocity);

        final double valueLower = maps.get(lowerDist).get(robotVelocity);

        if (Math.abs(lowerDist - upperDist) < 1e-6)
            return valueLower;

        final double valueUpper = maps.get(upperDist).get(robotVelocity);
        final double t = (distance - lowerDist) / (upperDist - lowerDist);

        return valueLower + t * (valueUpper - valueLower);
    }

